import React from 'react';

const TodoItem = ({id, title, description, onChange}) => {
return (<div className='card'>
<li key={id}>
<input value={title} onChange={(e)=> {onChange(e)}}/>
<input value={description}/>
<button> Trash </button>
{id}
</li>
</div>)
}

export default TodoItem;
